import Layout from '../components/Layout';
import Image from 'next/image';

const About = () => (
  <Layout>
    <div>
    <Image
        alt="climbing-quote icon"
        src="/climbing-quote.png"
        layout="intrinsic"
        width={1000}
        height={700}
        />
    </div>
  </Layout>
  );

  export default About;
